INSERT INTO `email_template_langs` (`id`, `parent_id`, `lang`, `subject`, `content`, `created_at`, `updated_at`) VALUES
(1, 1, 'ar', 'Order Complete', '<p>مرحبا ،</p><p>مرحبا بك في {app_name}.</p><p>مرحبا ، {order_name} ، شكرا للتسوق</p><p>قمنا باستلام طلب الشراء الخاص بك ، سيتم الاتصال بك قريبا !</p><p>شكرا ،</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:09', '2022-10-01 07:09:09'),
(2, 1, 'da', 'Order Complete', '<p>Hej, &nbsp;</p><p>Velkommen til {app_name}.</p><p>Hej, {order_name}, tak for at Shopping</p><p>Vi har modtaget din købsanmodning.</p><p>Tak,</p><p>{app_navn}</p><p>{order_url}</p>', '2022-10-01 07:09:09', '2022-10-01 07:09:09'),
(3, 1, 'de', 'Order Complete', '<p>Hello, &nbsp;</p><p>Willkommen bei {app_name}.</p><p>Hi, {order_name}, Vielen Dank für Shopping</p><p>Wir haben Ihre Kaufanforderung erhalten, wir werden in Kürze in Kontakt sein!</p><p>Danke,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:09', '2022-10-01 07:09:09'),
(4, 1, 'en', 'Order Complete', '<p>Hello,&nbsp;</p><p>Welcome to {app_name}.</p><p>Hi, {order_name}, Thank you for Shopping</p><p>We received your purchase request, we\'ll be in touch shortly!</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:09', '2022-10-01 07:09:09'),
(5, 1, 'es', 'Order Complete', '<p>Hola, &nbsp;</p><p>Bienvenido a {app_name}.</p><p>Hi, {order_name}, Thank you for Shopping</p><p>Recibimos su solicitud de compra, ¡estaremos en contacto en breve!</p><p>Gracias,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(6, 1, 'fr', 'Order Complete', '<p>Bonjour, &nbsp;</p><p>Bienvenue dans {app_name}.</p><p>Hi, {order_name}, Thank you for Shopping</p><p>We reçus your purchase request, we \'ll be in touch incess!</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(7, 1, 'it', 'Order Complete', '<p>Ciao, &nbsp;</p><p>Benvenuti in {app_name}.</p><p>Ciao, {order_name}, Grazie per Shopping</p><p>Abbiamo ricevuto la tua richiesta di acquisto, noi \\ saremo in contatto a breve!</p><p>Grazie,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(8, 1, 'ja', 'Order Complete', '<p>こんにちは &nbsp;</p><p>{app_name}へようこそ。</p></p><p><p>こんにちは、 {order_name}、お客様の購買要求書をお受け取りいただき、すぐにご連絡いたします。</p><p>ありがとうございます。</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(9, 1, 'nl', 'Order Complete', '<p>Hallo, &nbsp;</p><p>Welkom bij {app_name}.</p><p>Hallo, {order_name}, Dank u voor Winkelen</p><p>We hebben uw aankoopaanvraag ontvangen, we zijn binnenkort in contact!</p><p>Bedankt,</p><p>{ app_name }</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(10, 1, 'pl', 'Order Complete', '<p>Hello, &nbsp;</p><p>Witamy w aplikacji {app_name}.</p><p>Hi, {order_name}, Dziękujemy za zakupy</p><p>Otrzymamy Twój wniosek o zakup, wkrótce będziemy w kontakcie!</p><p>Dzięki,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(11, 1, 'ru', 'Order Complete', '<p>Здравствуйте, &nbsp;</p><p>Вас приветствует {app_name}.</p><p>Hi, {order_name}, Спасибо за Шоппинг</p><p>Мы получили ваш запрос на покупку, мы \\ скоро свяжемся!</p><p>Спасибо,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(12, 1, 'pt', 'Order Complete', '<p>NAVE ÓRICA-Тутутутугальстугальский (app_name}).</p><p>Hi, {order_name}, пасссский</p><p>польстугальский потугальский (португальский), \"скортугальский\".</p><p>nome_do_appсссский!</p><p>{app_name}</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(13, 2, 'ar', 'Order Status', '<p> مرحبًا ، </p> <p> مرحبًا بك في {app_name}. </p> <p> طلبك هو {order_status}! </p> <p> مرحبًا {order_name} ، شكرًا لك على التسوق </p> <p> شكرًا ، </ p> <p> {app_name} </p> <p> {order_url} </p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(14, 2, 'da', 'Order Status', '<p>Hej, &nbsp;</p><p>Velkommen til {app_name}.</p><p>Din ordre er {order_status}!</p><p>Hej {order_navn}, Tak for at Shopping</p><p>Tak,</p><p>{app_navn}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(15, 2, 'de', 'Order Status', '<p>Hello, &nbsp;</p><p>Willkommen bei {app_name}.</p><p>Ihre Bestellung lautet {order_status}!</p><p>Hi {order_name}, Danke für Shopping</p><p>Danke,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(16, 2, 'en', 'Order Status', '<p>Hello,&nbsp;</p><p>Welcome to {app_name}.</p><p>Your Order is {order_status}!</p><p>Hi {order_name}, Thank you for Shopping</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(17, 2, 'es', 'Order Status', '<p>Hola, &nbsp;</p><p>Bienvenido a {app_name}.</p><p>Your Order is {order_status}!</p><p>Hi {order_name}, Thank you for Shopping</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(18, 2, 'fr', 'Order Status', '<p>Bonjour, &nbsp;</p><p>Bienvenue dans {app_name}.</p><p>Votre commande est {order_status} !</p><p>Hi {order_name}, Thank you for Shopping</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:10', '2022-10-01 07:09:10'),
(19, 2, 'it', 'Order Status', '<p>Ciao, &nbsp;</p><p>Benvenuti in {app_name}.</p><p>Il tuo ordine è {order_status}!</p><p>Ciao {order_name}, Grazie per Shopping</p><p>Grazie,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(20, 2, 'ja', 'Order Status', '<p>Ciao, &nbsp;</p><p>Benvenuti in {app_name}.</p><p>Il tuo ordine è {order_status}!</p><p>Ciao {order_name}, Grazie per Shopping</p><p>Grazie,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(21, 2, 'nl', 'Order Status', '<p>Hallo, &nbsp;</p><p>Welkom bij {app_name}.</p><p>Uw bestelling is {order_status}!</p><p>Hi {order_name}, Dank u voor Winkelen</p><p>Bedankt,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(22, 2, 'pl', 'Order Status', '<p>Hello, &nbsp;</p><p>Witamy w aplikacji {app_name}.</p><p>Twoje zamówienie to {order_status}!</p><p>Hi {order_name}, Dziękujemy za zakupy</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(23, 2, 'ru', 'Order Status', '<p>Здравствуйте, &nbsp;</p><p>Вас приветствует {app_name}.</p><p>Ваш заказ-{order_status}!</p><p>Hi {order_name}, Thank you for Shopping</p><p>Thanks,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(24, 2, 'pt', 'Order Status', '<p>SHOPPING CENTER-Тутутутугальстугальский (app_name}).</p><p>nomeia альстугальский (order_status}!</p><p>Hi {order_name}, Obrigado por Shopping</p><p>Obrigado,</p><p>{app_name}</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(25, 3, 'ar', 'Order Detail', '<p> مرحبًا ، </ p> <p> عزيزي {owner_name}. </p> <p> هذا أمر تأكيد {order_id} ضعه على <span style = \\\"font-size: 1rem؛\\\"> {order_date}. </span> </p> <p> شكرًا ، </ p> <p> {order_url} </p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(26, 3, 'da', 'Order Detail', '<p>Hej </p><p>Kære {owner_name}.</p><p>Dette er ordrebekræftelse {order_id} sted på <span style=\\\"font-size: 1rem;\\\">{order_date}. </span></p><p>Tak,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(27, 3, 'de', 'Order Detail', '<p>Hallo, </p><p>Sehr geehrter {owner_name}.</p><p>Dies ist die Auftragsbestätigung {order_id}, die am <span style=\\\"font-size: 1rem;\\\">{order_date} aufgegeben wurde. </span></p><p>Danke,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(28, 3, 'en', 'Order Detail', '<p>Hello,&nbsp;</p><p>Dear {owner_name}.</p><p>This is Confirmation Order {order_id} place on&nbsp;<span style=\\\"font-size: 1rem;\\\">{order_date}.</span></p><p>Thanks,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(29, 3, 'es', 'Order Detail', '<p> Hola, </p> <p> Estimado {owner_name}. </p> <p> Este es el lugar de la orden de confirmación {order_id} en <span style = \\\"font-size: 1rem;\\\"> {order_date}. </span> </p> <p> Gracias, </p> <p> {order_url} </p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(30, 3, 'fr', 'Order Detail', '<p>Bonjour, </p><p>Cher {owner_name}.</p><p>Ceci est la commande de confirmation {order_id} passée le <span style=\\\"font-size: 1rem;\\\">{order_date}. </span></p><p>Merci,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(31, 3, 'it', 'Order Detail', '<p>Ciao, </p><p>Gentile {owner_name}.</p><p>Questo è l\'ordine di conferma {order_id} effettuato su <span style=\\\"font-size: 1rem;\\\">{order_date}. </span></p><p>Grazie,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(32, 3, 'ja', 'Order Detail', '<p>こんにちは、</ p> <p>親愛なる{owner_name}。</ p> <p>これは、<span style = \\\"font-size：1rem;\\\"> {order_date}の確認注文{order_id}の場所です。 </ span> </ p> <p>ありがとうございます</ p> <p> {order_url} </ p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(33, 3, 'nl', 'Order Detail', '<p>Hallo, </p><p>Beste {owner_name}.</p><p>Dit is de bevestigingsopdracht {order_id} die is geplaatst op <span style=\\\"font-size: 1rem;\\\">{order_date}. </span></p><p>Bedankt,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(34, 3, 'pl', 'Order Detail', '<p>Witaj, </p><p>Drogi {owner_name}.</p><p>To jest potwierdzenie zamówienia {order_id} złożone na <span style=\\\"font-size: 1rem;\\\">{order_date}. </span></p><p>Dzięki,</p><p>{order_url}</p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(35, 3, 'ru', 'Order Detail', '<p> Здравствуйте, </p> <p> Уважаемый {owner_name}. </p> <p> Это подтверждение заказа {order_id} на <span style = \\\"font-size: 1rem;\\\"> {order_date}. </span> </p> <p> Спасибо, </p> <p> {order_url} </p>', '2022-10-01 07:09:11', '2022-10-01 07:09:11'),
(36, 3, 'pt', 'Order Detail', '<p> Térica-Dicas de Cadeia Pública de Тутутугальский (owner_name}). </p> <p> Тугальстугальстугальский (order_id} ний <span style = \\\" font-size: 1rem; \\ \"> {order_date}. </span> </p> <p> nome_do_chave de vida, </p> <p> {order_url} </p> <p> {order_url}', '2022-10-01 07:09:11', '2022-10-01 07:09:11');
